import React from "react"
import Header from "./Header"
import Footer from "./Footer"
import Note from "./Note"
import Notes from "../notes"

function CreateNotes(note)
{
    return(
        <Note 
       title={note.title}
       meaning={note.content}

        />
    )
}
function App(){
    return <div>
        <Header />
\
        <Footer />
        
    </div>
}
export default App;
